public void clearDistances()
{
    System.out.println("Clearing distance data...");
    Iterator it = nodes.values().iterator();
    int nr = 0;
    while (it.hasNext())
    {
        Node n = (Node) it.next();
        nr++;
        n.setDistance(Float.MAX_VALUE);
    }
    System.out.println("cleared " + nr + " nodes. done");

}

